  `dept_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '部门名称',
  `dept_leader` bigint(0) NULL DEFAULT NULL COMMENT '部门负责人',
